import React from 'react';

function ExerciseList({ exercises, onEdit, onDelete }) {
  return (
    <table>
      <thead>
        <tr>
          <th>ID</th>
          <th>Nombre</th>
          <th>Acciones</th>
        </tr>
      </thead>
      <tbody>
        {exercises.map((exercise, index) => (
          <tr key={index}>
            <td>{exercise.id_ejericio}</td>
            <td>{exercise.nombreEjecicio}</td>
            <td>
              <button onClick={() => onEdit(exercise)}>Editar</button>
              <button onClick={() => onDelete(exercise.id)}>Eliminar</button>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default ExerciseList;
